import { useState } from 'react'

const Register = () => {
    const [formData, setFormData] = useState({
        name: "",
        email: "",
        password: "",
        password2: ""
    })
    const { name, email, password, password2 } = formData
    return (
        <div>Register</div>
    )
}

export default Register
